user/fa23969f5fc8411aeccc6796585a0aac/7KATh7zloInzYb7lc0qkA3axojYMCU8TBkl0V7OX.jpeg',NULL,NULL,'2018-06-06 15:19:30','2018-06-06 17:38:17'),(22,'f6ef7619aed23e2110b4a5a12516fbc0',1,610000,610100,610112,'灰熊家族科技网络有限公司','灰熊家族网络',NULL,'02989379297','龙首村印象城','陕西省西安市未央区','扛把子公司啥都能干。','user/f6ef7619aed23e2110b4a5a12516fbc0/ALzHyykl3rh80eob5zqcdIbc6OuA3B7OW8a7DSqX.jpeg',NULL,NULL,'2018-06-06 15:49:42','2018-06-11 16:38:52'),(23,'770d881e5a146c4aa2bb3bd8b0ce3ded',1,410000,410100,410102,'周大福珠宝集团','周大福',NULL,'029-89326234','河南省周口市鹿邑县郭小集附近','河南省郑州市中原区','周大福官方商城是周大福珠宝集团的官方电子商务平台，囊括黄金、钻石、铂金、K金、宝石等，致力于为顾客提供全新、可信、贴心的珠宝网购体验。周大福珠宝金行有限公司为周大福集团全资附属公司，拥有超过80年历史，是中国内地及香港著名的珠宝首饰品牌。','user/770d881e5a146c4aa2bb3bd8b0ce3ded/NcACW9Ud1Jb3PcVW1UmnWNRdnnMlwsH0I5uD74jT.jpeg',NULL,NULL,'2018-06-09 09:25:34','2018-06-09 09:25:34');

