/*Table structure for table `fixture_conf_vipfunctionpoint` */

DROP TABLE IF EXISTS `fixture_conf_vipfunctionpoint`;

CREATE TABLE `fixture_conf_vipfunctionpoint` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
