7 14:55:43'),(77,'96271d81ff85a9e9f652a91c974e50e1',20,71,40,NULL,NULL,51,'我在人民广场吃炸鸡',NULL,'房子从最开始毛坯到装修完成后的明亮大气，得感谢认真负责又吃苦耐劳的设计设、项目经理以及身怀各种技艺的装修工人师傅，以及在他们背后默默支持的其他工作人员。装修过程中已经和他们建立了深厚的信任基础，整个装修过程让我感到很顺畅、自然和舒服。这也算是一种难得缘分，谢谢他们。\r\n\r\n接下来是他家的施工过程记录，我们一起来见证整个蜕变的过程吧。\r\n\r\n先是水电验收，10天的时间内，装修师傅们把该砸掉的墙砸掉了，把水、电路做好了。',0,'33',1,'2018-06-07 14:57:29'),(78,'3203a451843701279934482aba634d54',20,69,45,NULL,NULL,51,'上海市浦东新区保利春天',NULL,'新建工地：感谢业主大大信任，上海市浦东新区保利春天今日开工啦。大吉大利，家宅平安!',0,'签约',1,'2018-06-07 17:32:05'),(79,'754ba403933db827b9036b85c6f8b943',20,69,45,NULL,NULL,51,'上海市浦东新区保利春天',NULL,'北欧风格（Nordic style）是指欧洲北部国家挪威、丹麦、瑞典、芬兰及冰岛等国的艺术设计风格（主要指室内设计以及工业产品设计），具有简洁、自然、人性化的特点。\r\n北欧风格在使大众利益得到关注的同时，北欧设计没有缺失对小众的关怀。例如消除残障人士在生活上的不便，为其设计便捷的人性设计，实现社会公平。它们都体现了北欧风格设计对人的周全关心。',0,'设计',1,'2018-06-07 17:36:24'),(80,'9e8b0ccf242e17fcf4c70c8131db837b',20,68,46,NULL,NULL,51,'浦西陆家嘴',NULL,'感谢业主大大信任，浦西陆家嘴今日开工啦。大吉大利，家宅平安!',0,'水电',1,'2018-06-08 11:58:01'),(81,'aade351bd1b7f7d4b1f9123b61398926',20,68,46,NULL,NULL,51,'浦西陆家嘴',NULL,'在正式做泥木工程之前要先把防水层打好，尤其是卫生间这样水汽比较大的地方，目前一般的楼房都是卫生间和浴室是一体的，所以卫生间经常会被水蒸气包围，因此棚顶的防潮非常重要。\r\n\r\n卫生间的管道也偏多，所以地面防水防滑以及墙顶防潮都非常重要。防水层的厚度大概是在1.5毫米以上。最重要的是，做完防水层以后一定要做闭水的测试。',0,'泥木',1,'2018-06-08 15:36:47'),(82,'54a726f1e4ff4886ed5be434b4a85f7d',23,73,47,NULL,NULL,63,'赛格国际购物中心',NULL,'感谢业主大大信任，赛格国际购物中心今日开工啦。大吉大利，家宅平安!',0,'签约',1,'2018-06-09 09:26:34'),(83,'f69cdb30d2215308db3c96f09c09c539',23,73,47,NULL,NULL,63,'赛格国际购物中心',NULL,'为什么装修公司在签约前，拒绝让业主带走预算？作为业主有权利要求人家给你？给你的理由是什么？你交钱了？你是上帝？似乎没有理由，当然这是站在装修公司角度。\r\n再站在业主角度：你不发我咋知道多钱？这是好多业主的理由。\r\n你可以来看呀，预算做出来，那是要讲解的，预算里头怎么做，为什么这么做，这么做有什么好处，所以才报这个价。如果给你发了，你看得懂吗？',0,'签约',1,'2018-06-09 09:31:56'),(84,'f015b5fe950f2a035779380bac5fdfc3',23,73,48,NULL,NULL,63,'华润二十四城',NULL,'感谢业主大大信任，华润二十四城今日开工啦。大吉大利，家宅平安!',0,'签约',1,'2018-06-09 09:33:11'),(85,'9f5a348d454367875c92f6fc3f0b3bc9',23,73,48,NULL,NULL,63,'华润二十四城',NULL,'特别是厚度超过24厘米以上的砖墙，一般都属于承重墙，不能轻易拆除和改造。承重墙承担着着楼盘的重量，维持着整个房屋结构的力的平衡。如果拆除了承重墙，破坏了这个力的平衡，造成的后果恐怕是沉重的、哪个业主都无法承担的生命的威胁。\r\n 家装中，除了承重墙是绝对不能拆的，轻体墙也不一定可以拆。有的轻体墙也承担着房屋的部分重量。比如，横梁下面的轻体墙就不可以拆——因为它也承担着房屋的部分重量。拆了，一样会破坏房屋结构。',0,'拆改',1,'2018-06-09 09:34:00'),(86,'03da3378fd022b2da54eb3e8cc7b8f95',23,73,49,NULL,NULL,63,'龙岗富士康',NULL,'感谢业主大大信任，龙岗富士康今日开工啦。大吉大利，家宅平安!',0,'瓦工',1,'2018-06-09 10:30:49'),(87,'a445e8749cb58c1d489a7585809c3125',23,73,49,NULL,NULL,63,'龙岗富士康',NULL,'、对于“砖混”结构的建筑，凡是钢筋混凝土墙一律不能拆除，也不能开门开窗。厚度超过24厘米以上的砖墙，一般都属于承重墙，不能轻易拆除和改造。\r\n2、门框是嵌在混凝土中的，不宜拆除，如果拆除或改造，就会破坏建筑结构，降低安全系数，重新安装门也比较困难。\r\n3、阳台边的矮墙不能拆除或改变。一般房间与阳台之间的墙上都有一门一窗，这些门窗可以拆除，但窗以下的墙不能拆，因为这段墙是“配重墙”，它就像秤砣一样起着挑起阳台的作用，如果拆除这堵墙，就会使阳台的承重力下降，导致阳台下坠。\r\n4、房间中的梁柱不能改。梁柱是用来支撑上',0,'瓦工',1,'2018-06-09 10:31:38'),(88,'d7cbcda211d3930e3f4b9928721d7a67',23,73,49,NULL,NULL,63,'龙岗富士康',NULL,'你要问我北京什么时候最美，那我告诉你十月的北京最美。天高云淡，凉爽宜人。而此时北京最美的景致，要属香山的秋色说起香山那我太有发言权了，因为每逢周末我们全家都要到香山公园去爬山。可以说我对香山的一草一木，一山一石都十分熟悉。香山地势峻峭，峰峦叠翠，泉沛林茂。主峰香炉峰（俗称鬼见愁）海拔557米。满山的古树名木数不胜数。这里的春天繁花似锦，这里的夏天凉爽宜人，这里的冬天银妆素裹。尤其是深秋时节，香山的秋色更是绚丽多彩，松柏林间点缀着银杏树、枫树，绿黄红相间，色彩斑斓。香山红叶以叶形如卵的黄栌缀着银杏树、枫树，',0,'设计',1,'2018-06-09 14:36:12'),(89,'c353df8e9fdae76628be2bc038560425',20,68,46,NULL,NULL,51,'浦西陆家嘴',NULL,'你要问我北京什么时候最美，那我告诉你十月的北京最美。天高云淡，凉爽宜人。而此时北京最美的景致，要属香山的秋色说起香山那我太有发言权了，因为每逢周末我们全家都要到香山公园去爬山。可以说我对香山的一草一木，一山一石都十分熟悉。香山地势峻峭，峰峦叠翠，泉沛林茂。主峰香炉峰（俗称鬼见愁）海拔557米。满山的古树名木数不胜数。这里的春天繁花似锦，这里的夏天凉爽宜人，这里的冬天银妆素裹。尤其是深秋时节，香山的秋色更是绚丽多彩，松柏林间点缀着银杏树、枫树，绿黄红相间，色彩斑斓。香山红叶以叶形如卵的黄栌缀着银杏树、枫树，',0,'泥木',1,'2018-06-09 14:41:07'),(90,'1e528db65589e5338b5df386da286d25',22,72,50,NULL,NULL,54,'灰熊小区',NULL,'感谢业主大大信任，灰熊小区今日开工啦。大吉大利，家宅平安!',0,'标8',1,'2018-06-09 17:49:05'),(91,'63122370997771718ef68f889bf4207d',22,72,50,NULL,NULL,54,'灰熊小区',NULL,'跟新了',0,'标9',1,'2018-06-09 17:50:29'),(92,'3d8b7b1f5d16d1498e7b785d4b28a11f',20,68,46,NULL,NULL,51,'浦西陆家嘴',NULL,'是软装的每一个区域、每一种产品都是整体环境的有机组成部分。也是在商业空间环境与居住空间环境中所有可移动的元素统称软装，也可称为软装修、软装饰。软装的元素包括家具、装饰画、陶瓷、花艺绿植、布艺、灯饰、其它装饰摆件等；软装范畴包括家庭住宅、商业空间，如酒店、会所、餐厅、酒吧、办公空间等等，只要有人类活动的室内空间都需要软装陈设。\r\n中文名 软装 外文名 Soft Decoration',0,'软装',1,'2018-06-11 09:43:48'),(93,'3e8b01b29847dc2fe034136d18d5d608',20,69,51,NULL,NULL,51,'湘江万达one',NULL,'感谢业主大大信任，湘江万达one今日开工啦。大吉大利，家宅平安!',0,'拆改',1,